import React from 'react';

class SearchPeopleConversation extends React.Component {
    render() {
        return (
            <div style={{ backgroundColor: 'green', width: '500px', height: '500px', position: 'absolute', top: '50%', left: '50%', WebkitTransform: 'translate(-50%, -50%)', transform: 'translate(-50%, -50%)', zIndex: '1000'}}></div>
        );
    }
}

export default SearchPeopleConversation;
